import styled from "styled-components";



export const Main =styled.main`
    position: relative;
    z-index: 1;
`;

export const Wrapper = styled.div``;

export const Context = styled.div`
    background:  url(${({ image }) => image}) no-repeat  ;
    color: black;
    background-size: 50%;

    .demandeVideo{
        text-align: center;
        height: 79px;
        color: white;

        .container{
            width: 498px;
            background: #242736;
            padding: 0px;
        }

        .demanderMaintnant{
            list-style-type: none;
            margin: 0;
            padding: 0;
            text-align: center;
        }

    }
`;

export const Image = styled.img`
    width: 372px;
    font-size: 29px;
    margin: auto;
    display: flex;
    text-align: center;
`;
